import Pokemon from "../models/pokemon";

type Props = {
  pokemon: Pokemon;
};

const PokemonCard: FunctionComponent<Props> = ({ pokemon }) => {
  return (
    <div>Ce composant est chargée d'afficher le pokémon : {pokemon.name}</div>
  );
};

export default PokemonCard;
